		function horseMove(e) {
			//console.log(e); //liat pencet apa aja
			if(this.HorseChars.x >= 900){
				this.HorseChars.x = -50;
			}else if(this.TigerChar.x >= 900){
				this.TigerChar.x = -50;
			}else if(this.FoxChars.x >= 900){
				this.FoxChars.x = -50;
			}else if(this.monkeyChars.x >= 900){
				this.monkeyChars.x = -50;
			}else if(this.eagleChars.x >= 900){
				this.eagleChars.x = -50;
			}else if(this.birdChars.x >= 850){
				this.birdChars.x = -50;
			}
			
			if (e.key == "H" || e.key == "h") {
				this.HorseChars.x += 3;
			} else if (e.key == "T" || e.key == "t") {
				this.TigerChar.x += 3;
			} else if (e.key == "F" || e.key == "f") {
				this.FoxChars.x += 2;
			}else if (e.key == "M" || e.key == "m") {
				this.monkeyChars.x += 2;
			}else if (e.key == "E" || e.key == "e") {
				this.eagleChars.x += 3;
			}else if (e.key == "C" || e.key == "c") {
				this.birdChars.x += 2;
			}
		}
		
